class Ref_path(object):
    def __init__(self, id, path:tuple, speed_limit = 60/3.6):
        if len(path[0]) != 2:
            raise ValueError("path should be a list of tuple (x, y)")
        self.id = id
        self.ref_path = path
        self.start_pt = path[0]
        self.speed_limit = speed_limit
        self._get_s()
        self._get_curve()
        self._get_speed_limit()
    
    def _get_s(self):
        dis = 0
        self.ref_path_s = [0]
        for i in range(1, len(self.ref_path)):
            dis += self._cal_dis(self.ref_path[i-1], self.ref_path[i])
            self.ref_path_s.append(dis)
        self.max_s = dis
    
    def _cal_dis(self, pt1, pt2):
        return math.sqrt((pt1[0]-pt2[0])**2 + (pt1[1]-pt2[1])**2)
    
    
    def _closest_point(self, point):
        """"""
        index = 0
        dis = 10
        closest_point = self.ref_path[0]
        s = d = -1
        for i in range(len(self.ref_path)):
            pt = self.ref_path[i]
            now_dis = self._cal_dis(point, pt)
            if now_dis < dis:
                index = i
                dis = now_dis
                closest_point = pt
        return closest_point, index
    
    def vector_at_s(self, s):
        vector = None
        """ return vector, v_vector  vector  L(90) -> v_vector """
        if s <0 or s > self.max_s:
            print(f"(vector_at_s(s))out of range, use first/end point, s:{s}")
        if s >= self.max_s:
            vector = np.array(self.ref_path[-1]) - np.array(self.ref_path[-2])
        elif s <= 0:
            vector = np.array(self.ref_path[1]) - np.array(self.ref_path[0])

        else :
            max_index = len(self.ref_path_s) - 1
            for i in range(max_index+1):
                # print(f"s:{s}, i:{i}, ss:{self.ref_path_s[i]}")
                if s <= self.ref_path_s[i]:
                    vector = np.array(self.ref_path[min(max_index,i+2)]) - np.array(self.ref_path[max(i-2, 0)])
                    break
            
            # for i in range(len(self.ref_path_s)):
            #     if s == self.ref_path_s[i]:
            #         vector = np.array(self.ref_path[i+1]) - np.array(self.ref_path[i-1])
            #         break
            #     elif s < self.ref_path_s[i]:
            #         vector = np.array(self.ref_path[i]) - np.array(self.ref_path[i-1])
            #         break
        # if vector is None:
        #     print(self.ref_path_s)
        #     print(s)
        vector = vector / math.sqrt(vector[0]**2 + vector[1]**2)
        v_vector = np.array([-vector[1], vector[0]])
        return vector, v_vector
    
    def angle_at_s(self, s):
        if s < 0 or s > self.max_s:
            print("s out of range")
            # return None
        if s <= 0:
            vector = np.array(self.ref_path[1]) - np.array(self.ref_path[0])

        elif s >= self.max_s:
            vector = np.array(self.ref_path[-1]) - np.array(self.ref_path[-2])
            
        else :
            max_index = len(self.ref_path_s) - 1
            for i in range(max_index+1):
                # print(f"s:{s}, i:{i}, ss:{self.ref_path_s[i]}")
                if s <= self.ref_path_s[i]:
                    vector = np.array(self.ref_path[min(max_index,i+2)]) - np.array(self.ref_path[max(i-2, 0)])
                    break

        return math.atan2((vector[1]),(vector[0]))
        
    def world_point_at_s(self, s):
        if s > self.max_s:
            print("(world_point_at_s(s))s out of range, >max")
            # return None
            s = self.max_s
        elif s < 0:
            print("(world_point_at_s(s))s out of range, <0")
            s = 0
        
        
        for i in range(len(self.ref_path_s)):
            if s == self.ref_path_s[i]:
                pt = np.array(self.ref_path[i])
                break
            elif s < self.ref_path_s[i]:
                vector = np.array(self.ref_path[i]) - np.array(self.ref_path[i-1])
                vector = vector / math.sqrt(vector[0]**2 + vector[1]**2)
                pt = np.array(self.ref_path[i-1]) + (s - self.ref_path_s[i-1]) * vector
                break
            
        return pt
    
    def coord_world_to_lane(self, point):
        """ point = (x,y) , return (s,d)"""
        point = np.array(point)
        closest_point, index = self._closest_point(point)
        vector = point - np.array(closest_point)
        vector_s, v_vector_s = self.vector_at_s(self.ref_path_s[index])
        # print(point)
        # print(closest_point)
        # print(vector_s)
        # print(v_vector_s)
        s = self.ref_path_s[index] + np.dot(vector, vector_s)
        d = np.dot(vector, v_vector_s)
        return (s, d)
    
    def coord_lane_to_world(self, point):
        """ point = (s,d) """
        
        vector, v_vector_s = self.vector_at_s(point[0])
        if point[0] > self.max_s:
            ds = point[0] - self.max_s
            base_pt = self.ref_path[-1] + ds * vector
        else:
            base_pt = self.world_point_at_s(point[0])
        pt = np.array(base_pt) + v_vector_s * point[1]

        return pt
    
    def get_pts(self, start_s=0, end_s = 0, ds = 1 ):
        end_s = self.max_s if end_s == 0 else end_s
        pts = []
        for s in np.arange(start_s, end_s+ds, ds):
            pt = self.world_point_at_s(s)
            pts.append(pt)
        return pts
    
    def project_along(self, s, dis):
        pass
    
    def _round(self, num, digit):
        return int(num * 10**digit +0.5) / 10**digit
    

    def cal_simple_curveture(self, s0,s1):
        if s0 > s1:
            s0,s1 = s1,s0
        s_mid = (s0 + s1) / 2
        xy0 = self.world_point_at_s(s0)
        xy1 = self.world_point_at_s(s1)
        xy2 = self.world_point_at_s(s_mid)
        # print(f"xy0:{xy0}, xy1:{xy1}, xy2:{xy2}")
        digit = 3
        a = self._round(self._cal_dis(xy0,xy1),digit)
        b = self._round(self._cal_dis(xy0,xy2),digit)
        c = self._round(self._cal_dis(xy1,xy2),digit)
        
        s = self._round((a + b + c) / 2,digit)
        if s == a or s == b or s == c:
            return 100000
            # return np.inf 
        # print(s, a, b, c, (s * (s - a) * (s - b) * (s - c)))
        temp = (s * (s - a) * (s - b) * (s - c))
        if temp <= 0:
            return 100000
        R = a * b * c / (4 * math.sqrt(temp))
        cross_product = np.cross(xy1 - xy0, xy2 - xy0)
        if cross_product > 0:
            return -R
        elif cross_product < 0:
            return R
        else:
            return 100000
            # raise Exception("cross_product = 0")

    def _get_curve(self, ds = 3) -> None:
        self.curve_s = []
        for s in range(0, int(self.max_s)):
            c = self.cal_simple_curveture(max(0,s-ds), min(self.max_s, s+ds))
            self.curve_s.append(c)
    
    def get_curveture(self, s):
        if(s < 0 or s > self.max_s):
            print("s out of range")
            return None

        index = int(s)
        c = self.curve_s[index]
        return c
    
    def cal_speed_limit(self, s):
        ds = 10
        c = abs(self.cal_simple_curveture(max(0,s-ds), min(self.max_s, s+ds)))
        if c <= 50:
            s_l = 0.8 * (-0.006 * c**2 + 0.6 * c + 3)
        else:
            s_l = self.speed_limit
        return s_l
    
    def _get_speed_limit(self):
        self.speed_limit_s = []
        for s in range(0, int(self.max_s)):
            s_l = self.cal_speed_limit(s)
            self.speed_limit_s.append(s_l)
            
    def speed_limit_at_s(self, s):
        if(s < 0 or s > self.max_s):
            print("s out of range")
            return None

        index = int(s)
        c = self.speed_limit_s[index]
        return c
    

