def get_k(RefPath: Ref_path, s, new_s, d):
    mid_s = (s+new_s)/2
    ss = (s+mid_s)/2
    sss = (mid_s+new_s)/2
    c_s = RefPath.curve_s[int(ss)]
    c_m = RefPath.curve_s[int(mid_s)]
    c_e = RefPath.curve_s[int(sss)]
    
    
    c_s = RefPath.curve_s[int(s)]
    c_e = RefPath.curve_s[int(new_s)]
    
    # print(f'c_m : {c_m}, (c_m - d):{(c_m - d)}')
    
    k1 = (c_s - d)/c_s
    k2 = (c_m - d)/c_m
    k3 = (c_e - d)/c_e

    if c_s >= 100000:
        k1 = 1
    elif c_m >= 100000:
        k2 = 1
    elif c_e >= 100000:
        k3 = 1
    
    k = (k1+k2+k3)/3
    # k = k2
    return k
    
def curvature_radius(p1, p2, p3):
    x1, y1 = p1
    x2, y2 = p2
    x3, y3 = p3

    # calculate the lengths of the three sides
    a = math.sqrt((x2 - x1) ** 2 + (y2 - y1) ** 2)
    b = math.sqrt((x3 - x2) ** 2 + (y3 - y2) ** 2)
    c = math.sqrt((x3 - x1) ** 2 + (y3 - y1) ** 2)
    print(a,b,c)
    s = (a + b + c) / 2
    if s == a or s == b or s == c:
        return np.inf 
    # print(s, a,b,c, s * (s - a) * (s - b) * (s - c))
    r = a * b * c / (4 * math.sqrt(s * (s - a) * (s - b) * (s - c)))

    return r

def cubic_smooth(x, y, num_points=100, kind = 'cubic'):
    # 对x进行标准化
    x_norm = (x - np.min(x)) / (np.max(x) - np.min(x))
    # 使用interp1d方法进行平滑
    f = interp1d(x_norm, y, kind=kind)
    # 对标准化的x进行均匀化
    x_new_norm = np.linspace(0, 1, num_points)
    # 将标准化的x代入平滑函数中，得到对应的y值
    y_new = f(x_new_norm)
    # 将标准化的x和y进行反标准化
    x_new = x_new_norm * (np.max(x) - np.min(x)) + np.min(x)
    # 返回插值函数和插值后的x和y值
    return f, x_new, y_new

