def get_kk(RefPath: Ref_path, s0,s1,d0,d1):
    mid_s = (s0 + s1) / 2
    ss1 = (s0 + mid_s) / 2
    ss2 = (mid_s + s1) / 2
    c_s = RefPath.get_curveture(ss1)
    
    c_m = RefPath.get_curveture(mid_s)
    curve_R_mid = c_m
    
    c_e = RefPath.get_curveture(ss2)
    
    if(c_s >= 100000):
        k1 = 1
    else:
        k1 = (c_s - d0)/c_s

    if(c_m >= 100000):
        k2 = 1
    else:
        k2 = (c_m - (d0+d1)/2)/c_m

    if(c_e >= 100000):
        k3 = 1
    else:
        k3 = (c_e - d1)/c_e

    return (k1+k2+k3)/3
    


